import { BrowserRouter, Routes, Route, createBrowserRouter,
  RouterProvider, } from 'react-router-dom';
import {

} from "react-router-dom";

// components
import Home from './pages/Home';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="pages">
          <Routes>
            <Route 
              path='/'
              element={<Home />}
            />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
